var canvas = document.getElementById("canvas");
var ctx = canvas.getContext('2d');
canvas.width = window.innerWidth;
canvas.height = window.innerHeight;
let particleArray = [];

////This will let the particles interact with the mouse
let mouse =
{
  x: null, 
  y: null,

  //The radius will define the size of a circle around the mouse 
  radius: 75
}

//This will have the access by defult at the event object
window.addEventListener('mousemove',
  function(event)
  {
    mouse.x = event.x + canvas.clientLeft/2;
    mouse.y = event.y + canvas.clientTop/2;
});

function drawImage()
{
  let imageWidth = jpg.width;
  let imageHeight = jpg.height;
  var data = ctx.getImageData(0, 0, imageWidth, imageHeight);
  ctx.clearRect(0, 0, canvas.width, canvas.height);

  //The particle will make the pixelated interactive image
  class Particle 
  {
    constructor(x, y, color, size)
     {

      //Image will be sent in the middle of the page
       this.x = x + canvas.width/2 - jpg.width * 2,
       this.y = y + canvas.height/2 - jpg.height *2,
       this.color = color,
       this.size = 2,

       //This will let the particles identify their original position of the photo when we move the mouse around the image
       this.baseX = x + canvas.width/2 - jpg.width * 2,
       this.baseY = y + canvas.height/2 - jpg.height *2,

       //Density will allow you to insert how fast the particles will move away from the mouse
       this.density = (Math.random() * 10) + 10;
     }

     draw()
     {
       ctx.beginPath();
       ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
       ctx.closePath();
       ctx.fill();
     }

     //This will calculate the movement and mouse interactions.
     update()
     {
       ctx.fillStyle = this.color;

       //collision detection will show you how close enough the particles for the mouse to start interacting
       let dx = mouse.x - this.x;
       let dy = mouse.y - this.y;
       let distance = Math.sqrt(dx * dx + dy * dy);

       //You will know how fast it pushed in y axis and x axis, it shows the direction of movement.
       let forceDirectionX = dx / distance;
       let forceDirectionY = dy / distance;

       //max distance, past that the force will be 0
       var maxDistance = 100;
       let force = (maxDistance - distance) / maxDistance;
       if (force < 0) force = 0;

      //This will slow the particles a little bit
       let directionX = (forceDirectionX * force * this.density * 1);
       let directionY = (forceDirectionY * force * this.density * 1);

       //collision detection where they will be travelling back to their original position 
       if (distance < mouse.radius + this.size) 
       {
         this.x -= directionX;
         this.y -= directionY;
       }

       else
       {
         if (this.x !== this.baseX)
         {
            let dx = this.x - this.baseX;
            this.x -= dx/20;
         }

         if (this.y !== this.baseY)
         {
            let dy = this.y - this.baseY;
            this.y -= dy/20;
         }
       }

       this.draw()

     } 
  }

  //the job of this function is to withdraw the position and color information of the image data object and it will store in a particle array 
  function init()
  {
    particleArray = [];

    for (let y = 0, y2 = data.height; y < y2; y++)
    {
      for (let x = 0, x2 = data.width; x < x2; x++)
      {
        if (data.data[(y * 4 * data.width) + (x * 4) + 3] > 128)
        {
          let positionX = x;
          let positionY = y;
          let color = "rgba(" + data.data[(y * 4 * data.width) + (x * 4)] + "," + 
                                data.data[(y * 4 * data.width) + (x * 4) + 1] + "," + 
                                data.data[(y * 4 * data.width) + (x * 4) + 2] + ")"; 
          particleArray.push(new Particle(positionX * 4, positionY * 4, color));

        }
      }
    }
  }

  //This will recreate our animation loop
  function animate()
  {
    requestAnimationFrame(animate);
    ctx.fillStyle = 'rgba(0, 0, 0, 0.5)';
    ctx.fillRect(0, 0, innerWidth, innerHeight);

    for (let i = 0; i < particleArray.length; i++)
    {
      particleArray[i].update();
    }
  }

  init();
  animate();

  //This will help by resizing the windows and still keep the quality of the image and animations
  window.addEventListener('resize',
    function()
    {
      canvas.width = innerWidth;
      canvas.height = innerHeight;
      init();
    });
}

var jpg = new Image();

//Image is converted to 64base thats why the code is long because it came from a website that convert it
jpg.src = "data:image/png;base64,";

//The reason why we put this function at the end of the code so that when a person opens the window, the picture should be fully loaded for it to be able to run the particles or else it will have an error
window.addEventListener('load', (event) => 
{
console.log('page has loaded');
ctx.drawImage(jpg, 0, 0);
drawImage();
});


